import React from "react";
import Header from './Header';
const Assistant = () => {
    return (
        <div>
            <Header />
            <div>
                <div>
                    <h1>Улучшение знания начинается здесь с ассистентами СДУ</h1>
                    <p></p>
                </div>
            </div>
        </div>
    );
}


export default Assistant;
